def solution(s)
  openings = ['(','[','{']
  closings = [')',']','}']
  opposite = {')' => '(', '}' => '{', ']' => '['}

  return 1 if s.empty?
  return 0 if s.length.odd?
  return 0 unless openings.include?(s[0])
  return 0 unless closings.include?(s[s.length - 1])
  return 0 if s.count('(') != s.count(')')
  return 0 if s.count('{') != s.count('}')
  return 0 if s.count('[') != s.count(']')

  stack = []
  for i in (0..s.length - 1)
    char = s[i]

    if openings.include?(char)
      stack << char
    elsif stack[stack.length-1].eql?(opposite[char])
      stack.delete_at(stack.length - 1)
    else
      return 0
    end

  end

  1
end

